import React, { useState } from 'react';
import { Route, Routes, Link, useNavigate } from 'react-router-dom';
import HomePage from './HomePage';
import CategoryPage from './CategoryPage';
import PhotoDetail from './PhotoDetail';
import { ThemeProvider, createTheme } from '@mui/material/styles';
import { Button, AppBar, Toolbar, Typography, Box, TextField, CssBaseline, IconButton, Drawer, List, ListItem, ListItemButton, ListItemText, Divider } from '@mui/material';
import MenuIcon from '@mui/icons-material/Menu';
const theme = createTheme({
  palette: {
    primary: {
      main: '#6366f1', // Indigo for modern
    },
    secondary: {
      main: '#06b6d4',
    },
    background: {
      default: '#f8fafc',
    },
  },
  components: {
    MuiCard: {
      styleOverrides: {
        root: {
          transition: 'transform 0.2s, box-shadow 0.2s',
          '&:hover': {
            transform: 'translateY(-4px)',
            boxShadow: '0 12px 40px rgba(0,0,0,0.15)',
          },
        },
      },
    },
  },
  typography: {
    fontFamily: '"Inter", "Roboto", sans-serif',
  },
});

function App() {
  const [searchTerm, setSearchTerm] = useState('');
  const [mobileOpen, setMobileOpen] = useState(false);
  const navigate = useNavigate();

  const handleDrawerToggle = () => {
    setMobileOpen(!mobileOpen);
  };

  const handleDrawerClose = () => {
    setMobileOpen(false);
  };

  const handleSearch = (event) => {
    event.preventDefault();
    if (searchTerm.trim()) {
      navigate(`/category/${searchTerm.trim()}`);
      setSearchTerm('');
      handleDrawerClose();
    }
  };

  return (
    <ThemeProvider theme={theme}>
      <CssBaseline />
      <AppBar position="static" elevation={0} sx={{ background: 'linear-gradient(135deg, #667eea 0%, #764ba2 100%)', boxShadow: '0 8px 32px rgba(102, 126, 234, 0.3)' }}>
        <Toolbar>
          <Typography variant="h5" component={Link} to="/" sx={{ color: 'white', textDecoration: 'none', flexGrow: 1, fontWeight: 700 }}>
            Fotoğraf Galerisi
          </Typography>

          <Box sx={{ display: { xs: 'none', md: 'flex' }, alignItems: 'center', gap: 1 }}>
            <Button color="inherit" component={Link} to="/category/nature" sx={{ textTransform: 'none' }}>Doğa</Button>
            <Button color="inherit" component={Link} to="/category/technology" sx={{ textTransform: 'none' }}>Teknoloji</Button>
            <Button color="inherit" component={Link} to="/category/travel" sx={{ textTransform: 'none' }}>Seyahat</Button>

            <Box component="form" onSubmit={handleSearch} sx={{ ml: 2, display: 'flex', alignItems: 'center' }}>
              <TextField
                variant="outlined"
                size="small"
                placeholder="Kategori ara..."
                value={searchTerm}
                onChange={(e) => setSearchTerm(e.target.value)}
                sx={{ 
                  '& .MuiOutlinedInput-root': {
                    borderRadius: 2,
                    '& fieldset': { borderColor: 'rgba(255, 255, 255, 0.3)' },
                    '&:hover fieldset': { borderColor: 'white' },
                    '&.Mui-focused fieldset': { borderColor: 'white' },
                  },
                  '& .MuiInputBase-input': { color: 'white' },
                  backgroundColor: 'rgba(255,255,255,0.1)',
                }}
              />
              <Button type="submit" sx={{ ml: 1, borderRadius: 2, textTransform: 'none' }}>Ara</Button>
            </Box>
          </Box>

          <IconButton
            color="inherit"
            aria-label="open drawer"
            edge="end"
            onClick={handleDrawerToggle}
            sx={{ display: { md: 'none' }, ml: 1 }}
          >
            <MenuIcon />
          </IconButton>
        </Toolbar>
      </AppBar>

      <Drawer
        variant="temporary"
        open={mobileOpen}
        onClose={handleDrawerToggle}
        ModalProps={{
          keepMounted: true,
        }}
        sx={{
          display: { md: 'none' },
          '& .MuiDrawer-paper': {
            boxSizing: 'border-box',
            width: 280,
          },
        }}
      >
        <Box sx={{ display: 'flex', flexDirection: 'column' }}>
          <List>
            {[
              { text: 'Doğa', to: '/category/nature' },
              { text: 'Teknoloji', to: '/category/technology' },
              { text: 'Seyahat', to: '/category/travel' },
            ].map((item) => (
              <ListItem key={item.text} disablePadding>
                <ListItemButton component={Link} to={item.to} onClick={handleDrawerClose}>
                  <ListItemText primary={item.text} />
                </ListItemButton>
              </ListItem>
            ))}
          </List>
          <Divider />
          <Box component="form" onSubmit={handleSearch} sx={{ p: 2, display: 'flex', flexDirection: 'column', gap: 2 }}>
            <TextField
              variant="outlined"
              size="small"
              placeholder="Kategori ara..."
              value={searchTerm}
              onChange={(e) => setSearchTerm(e.target.value)}
              sx={{
                '& .MuiOutlinedInput-root': { borderRadius: 2 },
                backgroundColor: 'background.default',
              }}
            />
            <Button type="submit" variant="contained" fullWidth sx={{ borderRadius: 2 }}>
              Ara
            </Button>
          </Box>
        </Box>
      </Drawer>

      <Box sx={{ minHeight: 'calc(100vh - 64px)', p: { xs: 2, md: 4 }, backgroundColor: 'background.default' }}>
        <Routes>
          <Route path="/" element={<HomePage />} />
          <Route path="/category/:category" element={<CategoryPage />} />
          <Route path="/photo/:id" element={<PhotoDetail />} />
        </Routes>
      </Box>
    </ThemeProvider>
  );
}

export default App;
